import TeacherHeader from "./TeacherHeader";
import { useState, useEffect  } from "react";
import axios from "axios";
import { Link, useParams } from "react-router-dom";
import './TeacherMyCourses.css';
import Swal from "sweetalert2";
import QuizResChild from "./QuizResChild";

const baseUrl='http://127.0.0.1:8000/api';

function AttemptedStudents(){

    useEffect(()=>{
        document.title='Attempted Students';
    });

    const [userData, setuserData] = useState([]);
    const {quiz_id} = useParams();
    

    useEffect(()=>{
        try{
            axios.get(baseUrl + '/attempted-quiz/'+ quiz_id).then((res)=>{
                setuserData(res.data);
            });
          }catch(error){
            console.log(error);
          }
    }, []);
    

    return(
        <>
        <TeacherHeader/>
        

        <table className="table">
  <thead>
    <tr>
      <th scope="col">Full name</th>
      <th scope="col">Email</th>
      <th scope="col">Username</th>
      <th scope="col">Result</th>
    </tr>
  </thead>
  <tbody>
  {userData.map((row, index) => 
    <tr>
      <td>{row.user.full_name}</td>
      <td>{row.user.email}</td>
      <td>{row.user.username}</td>
      <td><button type="button" class="btn btn-primary" data-bs-toggle="modal" data-bs-target={`#exampleModal${row.id}`}>
            Result
          </button>

          <div class="modal fade" id={`exampleModal${row.id}`} tabindex="-1" aria-labelledby="exampleModalLabel" aria-hidden="true">
           <QuizResChild quiz={row.quiz.id} user={row.user.id}/>
          </div>
        
      </td>
    </tr>
  )}
</tbody>
</table>


      
        </>
    );
}
export default AttemptedStudents;
